In this video, we are looking at escaping a ground headlock. In this situation, the opponent's head and leg are down too far to hook. What we do in this case is we bridge up and tripod to our knees, and as we get on our knees, we ensure to put 100% of our weight onto our opponent (not onto our head), shoulder to shoulder. We then pull up on the opponent's wrist, creating a kimura-like pressure onto their shoulder and forcing them to let go. Although we could then move to taking the back, which might risk to injure their arm given its current position. So in this situation, for the sake of our partner, we will simply extract our head and disengage.

